import React, { useState } from "react";
import { Link } from "react-router-dom";

export default function PassGen() {
  // State for password generation options
  const [password, setPassword] = useState("");
  const [length, setLength] = useState(16);
  const [includeNumbers, setIncludeNumbers] = useState(true);
  const [includeSymbols, setIncludeSymbols] = useState(true);
  const [copyMessage, setCopyMessage] = useState("");

  // Character sets for password generation
  const lowerChars = "abcdefghijklmnopqrstuvwxyz";
  const upperChars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
  const numberChars = "0123456789";
  const symbolChars = "!@#$%^&*()_+-=[]{}|;:,.<>?";

  // Function to generate the password
  const generatePassword = () => {
    let charSet = lowerChars + upperChars;
    if (includeNumbers) {
      charSet += numberChars;
    }
    if (includeSymbols) {
      charSet += symbolChars;
    }

    let newPassword = "";
    for (let i = 0; i < length; i++) {
      const randomIndex = Math.floor(Math.random() * charSet.length);
      newPassword += charSet[randomIndex];
    }
    setPassword(newPassword);
    setCopyMessage(""); // Reset copy message on new generation
  };

  // Function to copy password to clipboard
  const copyToClipboard = () => {
    if (!password) return; // Don't copy if there's no password
    navigator.clipboard.writeText(password);
    setCopyMessage("Copied! ✅");
    setTimeout(() => setCopyMessage(""), 2000); // Message disappears after 2 seconds
  };

  // Generate a password on initial component load
  useState(() => {
    generatePassword();
  }, []);

  return (
    <div style={{ padding: 24, fontFamily: "system-ui, -apple-system, Segoe UI, Roboto, sans-serif", maxWidth: 600, margin: "auto" }}>
      <h1 style={{ marginTop: 0 }}>Password Generator</h1>
      <p style={{ color: "#6b7280" }}>Create strong, secure passwords tailored to your needs.</p>

      {/* Password Display and Copy Button */}
      <div style={{ display: "flex", gap: 10, marginBottom: 20 }}>
        <input
          type="text"
          value={password}
          readOnly
          placeholder="Your new password will appear here"
          style={{ flexGrow: 1, padding: "10px 12px", border: "1px solid #e5e7eb", borderRadius: 6, fontSize: 16, background: "#f9fafb" }}
        />
        <button 
          onClick={copyToClipboard}
          style={{ padding: "10px 16px", background: "#2563eb", color: "white", border: "none", borderRadius: 6, cursor: "pointer" }}
        >
          {copyMessage ? copyMessage : "Copy"}
        </button>
      </div>

      {/* Options */}
      <div style={{ display: "flex", flexDirection: "column", gap: 16, border: "1px solid #e5e7eb", borderRadius: 8, padding: 20 }}>
        {/* Length Slider */}
        <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between" }}>
          <label htmlFor="length">Password Length:</label>
          <span style={{ fontSize: 18, fontWeight: 700, minWidth: 40, textAlign: "center" }}>{length}</span>
          <input
            id="length"
            type="range"
            min="8"
            max="64"
            value={length}
            onChange={(e) => setLength(e.target.value)}
            style={{ flexGrow: 1, marginLeft: 16 }}
          />
        </div>

        {/* Checkboxes */}
        <div style={{ display: "flex", gap: 24 }}>
          <label style={{ display: "flex", alignItems: "center", gap: 8 }}>
            <input
              type="checkbox"
              checked={includeNumbers}
              onChange={() => setIncludeNumbers(!includeNumbers)}
            />
            Include Numbers (0-9)
          </label>
          <label style={{ display: "flex", alignItems: "center", gap: 8 }}>
            <input
              type="checkbox"
              checked={includeSymbols}
              onChange={() => setIncludeSymbols(!includeSymbols)}
            />
            Include Symbols (!@#$)
          </label>
        </div>

        {/* Generate Button */}
        <button 
          onClick={generatePassword}
          style={{ padding: "12px", background: "#16a34a", color: "white", border: "none", borderRadius: 6, cursor: "pointer", fontSize: 16, marginTop: 10 }}
        >
          Generate New Password
        </button>
      </div>

      <Link to="/" style={{ color: "#2563eb", display: "inline-block", marginTop: 24 }}>← Back to Home</Link>
    </div>
  );
}
